import React from 'react';
import { StyleSheet, Button } from 'react-native';

import { View } from './Themed';

import { Auth } from 'aws-amplify';

import Components_Chat from '../components/Components_Chat';

export default function Components_SingOut({ onChangeLogin }: { onChangeLogin: any }) {
    return (
        <View style={{paddingTop: 50}}>
            <Button
                onPress={async() => {
                    await signOut
                    onChangeLogin(false)
                    console.log("Button SingOut")
                }}
                title="Sing Out of the chat"
                color="#ff9900"
            />
            {/* <View>
                <Components_Chat path="/screens/Components_Login.tsx" />
            </View> */}
        </View>
    );
}

async function signOut(onChangeLogin: any) {
    console.log("onChangeLogin", onChangeLogin);
    // onChangeLogin(false)
    try {
        await Auth.signOut({ global: true });
    } catch (error) {
        console.log('error signing out: ', error);
    }
}


